  mainContainer: {
    backgroundColor: "#6a6d73",
  }
}));


function App() {
  const classes = useStyles(theme);
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div className="App">
        <ThemeProvider theme={theme}>
          <CssBaseline />
          <div className={classes.mainContainer}>

            <Home />



            <Footer />
          </div>

        </ThemeProvider>

    </div>
  );
}

export default App;
